import React from "react";
import "../images/airbnb1.png"
import "../index.css";

const Navbar = () => {
    return(
        <div>
            <nav className="navbar">
                <img src="../images/airbnb1.png" alt="airbnb-logo" className="airbnblogo" />
            </nav>
        </div>
    )
}

export default Navbar;
